          name="Login" 
          component={Login} 
          options={
            {title: 'Login'}
          }
        />
        <Stack.Screen 
         name="Dashboard" 
         component={Dashboard} 
         options={
           { title: 'Dashboard' }
         } 
        />}*/
     // </Stack.Navigator>
    );
  }
